import React from "react";
import videoImg1 from "../assets/Video_Image_1.jpeg";
import videoImg2 from "../assets/Video_Img_2.jpeg";
import videoImg3 from "../assets/Video_Img_3.jpeg";

const VideoList = () => {
  return (
    <section>
      <div>
        <img className="videoThumbnail" src={videoImg1}></img>
        <h4>Title:</h4>
        <h5>Description</h5>
      </div>
      <div>
        <img className="videoThumbnail" src={videoImg2}></img>
        <h4>Title:</h4>
        <h5>Description</h5>
      </div>
      <div>
        <img className="videoThumbnail" src={videoImg3}></img>
        <h4>Title:</h4>
        <h5>Description</h5>
      </div>
    </section>
  );
};

export default VideoList;
